import React from 'react';

const Nav = () => {
    return (
      <header class="text-white bg-black body-font">
        <div class="container mx-auto flex flex-wrap p-5 flex-col md:flex-row items-center">
          <a class="flex title-font font-medium font-semibold items-center text-rose-600 mb-4 md:mb-0">
  
            <span class="ml-2 text-xl">Tailblocks</span>
          </a>
          <nav class="md:ml-auto md:mr-auto flex flex-wrap items-center text-base justify-center">
            <a class="mr-3 text-sm hover:scale-10 md:mr-7 hover:text-rose-900">First Link</a>
            <a class="mr-3 text-sm hover:scale-10 md:mr-7 hover:text-rose-900">Second Link</a>
            <a class="mr-3 text-sm hover:scale-10 md:mr-7 hover:text-rose-900">Third Link</a>
            <a class="mr-3 text-sm hover:scale-10 md:mr-7 hover:text-rose-900">Fourth Link</a>
          </nav>
          <button class="inline-flex items-center  border-0 py-1 px-3 "></button>
        
        </div>
      </header>
    );
};

export default Nav;
